IF NOT EXISTS (SELECT * FROM ThongBao WHERE maThongBao = 'TB001') INSERT INTO ThongBao (maThongBao, tieuDe, noiDung, ngayDang) VALUES ('TB001', N'Chào mừng năm học mới 2025-2026', N'Ban quản lý KTX chào mừng các bạn sinh viên quay trở lại trường. Chúc các bạn một năm học mới nhiều thành công.', '2025-08-15');
IF NOT EXISTS (SELECT * FROM ThongBao WHERE maThongBao = 'TB002') INSERT INTO ThongBao (maThongBao, tieuDe, noiDung, ngayDang) VALUES ('TB002', N'Thông báo nộp tiền điện nước tháng 9/2025', N'Đề nghị các phòng trưởng các phòng nộp tiền điện nước tháng 9 trước ngày 10/10/2025. Quá hạn sẽ bị cắt điện.', '2025-10-01');
IF NOT EXISTS (SELECT * FROM ThongBao WHERE maThongBao = 'TB003') INSERT INTO ThongBao (maThongBao, tieuDe, noiDung, ngayDang) VALUES ('TB003', N'Lịch phun thuốc muỗi đợt 1', N'Nhà trường sẽ tiến hành phun thuốc muỗi toàn bộ khu KTX vào sáng Chủ Nhật ngày 20/10/2025. Đề nghị các bạn sinh viên dọn dẹp phòng ở gọn gàng.', '2025-10-15');
IF NOT EXISTS (SELECT * FROM ThongBao WHERE maThongBao = 'TB004') INSERT INTO ThongBao (maThongBao, tieuDe, noiDung, ngayDang) VALUES ('TB004', N'Đăng ký ở lại hè 2025', N'Sinh viên có nhu cầu ở lại hè 2025 vui lòng đăng ký tại văn phòng BQL trước ngày 30/05/2025.', '2025-05-01');
IF NOT EXISTS (SELECT * FROM ThongBao WHERE maThongBao = 'TB005') INSERT INTO ThongBao (maThongBao, tieuDe, noiDung, ngayDang) VALUES ('TB005', N'Thông báo cắt điện bảo trì trạm biến áp', N'Để phục vụ công tác bảo trì, KTX sẽ cắt điện toàn khu A1, A2 từ 8h00 đến 17h00 ngày 05/11/2025.', '2025-11-01');
IF NOT EXISTS (SELECT * FROM ThongBao WHERE maThongBao = 'TB006') INSERT INTO ThongBao (maThongBao, tieuDe, noiDung, ngayDang) VALUES ('TB006', N'Giải bóng đá KTX mở rộng', N'Đoàn thanh niên tổ chức giải bóng đá KTX. Các phòng đăng ký tham gia tại phòng trực ban trước ngày 15/11/2025.', '2025-11-05');
IF NOT EXISTS (SELECT * FROM ThongBao WHERE maThongBao = 'TB007') INSERT INTO ThongBao (maThongBao, tieuDe, noiDung, ngayDang) VALUES ('TB007', N'Quy định về an toàn phòng cháy chữa cháy', N'Nghiêm cấm sinh viên đun nấu trong phòng. Vi phạm sẽ bị xử lý kỷ luật.', '2025-09-05');
IF NOT EXISTS (SELECT * FROM ThongBao WHERE maThongBao = 'TB008') INSERT INTO ThongBao (maThongBao, tieuDe, noiDung, ngayDang) VALUES ('TB008', N'Thông báo tuyển cộng tác viên tự quản', N'Ban quản lý tuyển 10 sinh viên tham gia đội tự quản KTX. Quyền lợi: Cộng điểm rèn luyện và ưu tiên xét duyệt phòng.', '2025-09-10');
IF NOT EXISTS (SELECT * FROM ThongBao WHERE maThongBao = 'TB009') INSERT INTO ThongBao (maThongBao, tieuDe, noiDung, ngayDang) VALUES ('TB009', N'Lịch thi học kỳ 1 năm học 2025-2026', N'Lịch thi dự kiến bắt đầu từ 15/12/2025. Sinh viên chú ý ôn tập.', '2025-11-20');
IF NOT EXISTS (SELECT * FROM ThongBao WHERE maThongBao = 'TB010') INSERT INTO ThongBao (maThongBao, tieuDe, noiDung, ngayDang) VALUES ('TB010', N'Thông báo về việc giữ gìn vệ sinh chung', N'Đề nghị sinh viên đổ rác đúng nơi quy định, không vứt rác ra hành lang.', '2025-09-20');
